import Card from './Card/Card';
import ItemCount from './ItemCount/ItemCount';

const cantidad = (clicks) =>{
    alert(`${clicks} items añadido al carrito`);
}


const ItemListContainer = ({greeting}) =>{
    return(
        <div>
            <br></br>
            <h1>{greeting}</h1>
            <Card/>
            <ItemCount initial={1} stock={3} cantidad={cantidad}/>
        </div>
    )
}

export default ItemListContainer
